import axios from 'axios';
import { useEffect, useState } from 'react';
import {Link} from 'react-router-dom';
import TeacherLogout from './TeacherLogout';
import './TeacherSidebar.css';

const baseUrl='http://127.0.0.1:8000/api';

function TeacherSidebar() {
    const teacherId = localStorage.getItem("teacherId")
    const [teacherData, setTeacherData] = useState(null)
  
    useEffect(() => {
      try {
          axios.get(baseUrl + '/teacher/' + teacherId + '/').then((res) => {
              setTeacherData(res.data)
          })
      } catch (error) {
          console.log(error)
      }
  }, [])
  
  if (!teacherData) {
      return <div>Loading...<Link to="/teacher-logout">Logout</Link></div>
  }

    return (
        <>
        <div class="card" id="sidebar">
          <div class="list-group list-group-flush">
          <Link to="/teacher-profile">
           <img src={teacherData.profile_img} alt="..." id="profile-img"/>
           <h5 id="sidebar-word">{teacherData.full_name}</h5>
           <h5 id="sidebar-text">Мұғалім</h5>
          </Link>
            
           <Link to="/teacher-my-courses" id="sidebar-el" class="list-group-item list-group-item-action"><i class="bi bi-book-half" id="sidebar-it" ></i>Менің курстарым</Link>
           <Link to="/teacher-add-course" id="sidebar-el" class="list-group-item list-group-item-action"><i class="bi bi-database-add" id="sidebar-it"></i>Курс қосу</Link>
           <Link to="/teacher-my-users" id="sidebar-el" class="list-group-item list-group-item-action"><i class="bi bi-people-fill" id="sidebar-it"></i>Студенттерім</Link>
           <Link to="/teacher-my-quizzes" id="sidebar-el" class="list-group-item list-group-item-action"><i class="bi bi-file-earmark-text-fill" id="sidebar-it"></i>Тест</Link>
           <Link to="/teacher-profile-settings" id="sidebar-el" class="list-group-item list-group-item-action"><i class="bi bi-gear-fill" id="sidebar-it"></i>Баптаулар</Link>
           <Link to="/teacher-change-password" id="sidebar-el" class="list-group-item list-group-item-action"><i class="bi bi-person-fill-lock" id="sidebar-it"></i>Құпия сөзді өзгерту</Link>
           <Link to="#" id="sidebar-el" class="list-group-item list-group-item-action" type="button" data-bs-toggle="modal" data-bs-target="#logoutModal"><i class="bi bi-x-circle-fill" id="sidebar-it"></i>Шығу</Link>

<div class="modal fade" id="logoutModal" tabIndex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div class="modal-dialog" role="document">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title" id="exampleModalLabel">Шығу</h5>
        <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div class="modal-body">
        Аккаунттан шығатыныңызға сенімдісіз бе?
      </div>
      <div class="modal-footer">
        <Link to="#" type="button" id="modal-button" data-bs-dismiss="modal"><i class="bi bi-x-circle-fill"></i></Link>
        <Link to="/teacher-logout" id="modal-button" type="button"><i class="bi bi-check-circle-fill"></i></Link>
      </div>
    </div>
  </div>
</div>
          </div>
        </div>


        </>
    );
}
export default TeacherSidebar;
